import React, { useState } from 'react';
import InfoLogin from './InfoLogin'
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Button,
//   NavbarText
} from 'reactstrap';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import TwitchIcon from '../images/twitch_icon.svg'
import TwitchV from '../images/twitchv.png'
import LogOutImg from '../images/logout.png'
import VotoImg from '../images/voto.png'
import TwitchView from '../images/twitch_view.svg'

import './styles/navbar.css'

export default class Navegador extends InfoLogin {
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);

  //   this.toggle = this.toggle.bind(this);
  //   this.state = {
  //     isOpen: false
  //   };
 }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  logout() {
    localStorage.clear();
    window.location.reload();
    // setTimeout(()=> {
    // s  this.setState({ load: false})
  // s }, 500)
  }
  
  render() {

  return (
    <Navbar light expand="md" className="shadow" style={{backgroundColor: "#FFF"}}>
          <Link  to="/" className="robotoTypo text-dark">Clips Army</Link>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
          {localStorage.getItem('logueado') == null ?
          <Nav className="ml-auto" navbar>
            <NavItem>

               {/* Para version Dev */}  
               <NavLink href='https://id.twitch.tv/oauth2/authorize?client_id=n24421j98tu90dqln9hrnknwj7jda7&redirect_uri=https://clips-army-dev.netlify.com/&response_type=token%20id_token&scope=openid&claims={ "id_token": { "email": null, "email_verified": null }, "userinfo": { "picture": null, "preferred_username": null } }'> 
                  
                  
                 {/*  Para version local 
             <NavLink href='https://id.twitch.tv/oauth2/authorize?client_id=n24421j98tu90dqln9hrnknwj7jda7&redirect_uri=http://localhost:3000/&response_type=token%20id_token&scope=openid&claims={ "id_token": { "email": null, "email_verified": null }, "userinfo": { "picture": null, "preferred_username": null } }'> 
              */}
              Iniciar Sesion 
            </NavLink>
            </NavItem>

          </Nav>
          :

          <Nav className="ml-auto" navbar>

            <NavItem>
              <NavLink href="/components/" className="upgrade">+Premium</NavLink>
            </NavItem>

            <NavItem>
              <NavLink href="/"><span className="level">Nivel: </span> <span className="level-number rounded-circle">{this.state.exp.level}</span></NavLink>
            </NavItem>

           
            <UncontrolledDropdown nav inNavbar className="navbar-right">
              <DropdownToggle nav caret>
                  <span className="username">{this.state.user}</span>
                  <img src={this.state.data.img} alt="Avatar Logo" className="rounded-circle img-user" />
              </DropdownToggle>
              <DropdownMenu right className="drop-menu-clipsarmy">
                <DropdownItem>
                 <h6 className="dropdown-header text-center">Visualizaciónes</h6> 
                 <p className="text-center"> <img src={TwitchView} width="15px"  className="dropdown-img"/>  {this.state.data.user_view} </p>
                </DropdownItem>
                <DropdownItem divider />
                <DropdownItem>
                 <h6 className="dropdown-header text-center"> Tipo de cuenta</h6> 
                 <p className="text-center"><img src={TwitchV} width="15px" className="dropdown-img"/> {this.state.data.user_badge} </p>
                </DropdownItem>
                <DropdownItem divider />
                <DropdownItem>
                 <h6 className="dropdown-header text-center">Votos enviados</h6> 
                 <p className="text-center line-auto"><img src={VotoImg} width="15px" className="dropdown-img" /> {this.state.exp.level}</p>
                </DropdownItem>
                <DropdownItem divider />
                <DropdownItem onClick={this.logout} className="text-center">
                 <img src={LogOutImg} className="logout-img" /> Cerrar sesión
                </DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>

          </Nav>
          
          }
        </Collapse>
    </Navbar>
  );
  }
}
